import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';
import Contact from './components/Contact';
import Navbar from './components/Navbar';
import Index from './components/Index';


import './App.css';

function App() {
  return (
    <div>
      <BrowserRouter >
        <Navbar />
        <Contact />
        <Index />
        <Route />
      </BrowserRouter>

    </div>
  );
}

export default App;
